import { NgModule } from '@angular/core';
import { RouterModule } from '@angular/router';

@NgModule({
  imports: [
    RouterModule.forChild([
      {
        path: 'nsman',
        data: { pageTitle: 'nspay2App.enquiry.nsman.home.title' },
        loadChildren: () => import('./nsman/enquiry-nsman.module').then(m => m.EnquiryNsmanModule),
      },
      {
        path: 'company',
        data: { pageTitle: 'nspay2App.enquiry.company.home.title' },
        loadChildren: () => import('./company/enquiry-company.module').then(m => m.EnquiryCompanyModule),
      }
    ]),
  ],
})
export class EnquiryRoutingModule { }
